const ParseWeatherToIcon = (description) => {
    switch (description.toLowerCase()) {
        case 'clear sky':
            return 'wi wi-day-sunny';
        case 'few clouds':
            return 'wi wi-cloudy';
        case 'scattered clouds':
            return 'wi wi-cloudy';
        case 'broken clouds':
            return 'wi wi-cloudy';
        case 'shower rain':
            return 'wi wi-showers';
        case 'rain':
            return 'wi wi-rain';
        case 'thunderstorm':
            return 'wi wi-thunderstorm';
        case 'snow':
            return 'wi wi-snow';
        case 'mist':
            return 'wi wi-dust';
    }
}

export default ParseWeatherToIcon
